(60, 6, 'Home', '', 'Home', '', ''),
(20, 6, 'קטגוריות', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n', 'Shop by Theme', 'Shop by Theme', 'Shop by Theme'),
(64, 1, 'Nature', '', 'Nature', '', ''),
(79, 6, 'Door Decal', '', 'Door Decal', '', ''),
(80, 6, 'אביזרים לבית', '&lt;p&gt;&lt;span id=&quot;docs-internal-guid-661991b4-7fff-cfae-118e-1215c1a953a7&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;It can be so much fun to decorate your home and to make it cozy and comfortable where you can relax after a long day. At stickers-center you\'ll find wall decorations, for your best home design. And because we deliver right to your door, decorating could not be more fun and easy!&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Home Accessories', '', ''),
(83, 6, 'Bathroom', '', 'Bathroom', '', ''),
(85, 6, 'Girls', '', 'Girls', '', ''),
(86, 6, 'Boys', '', 'Boys', '', ''),
(59, 6, 'Babies', '', 'babies', 'Babies', 'Babies'),
(75, 1, 'Kitchen', '&lt;p&gt;&lt;span style=&quot;text-align: center; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Give your kitchen a wonderful wall sticker to create a warm family feeling. A wonderful quote, recipe, or a nice wall sticker&amp;nbsp;with flowers, food or vegetables. Bon Appetit!&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Kitchen', '', ''),
(70, 1, 'Babies Room', '&lt;p&gt;Baby room wall stickers are actually the ideal design solution for our little ones room. Inspiring a vivid atmosphere in the nursery is a very simple and fun job to do when using wall stickers for a nursery. The wall stickers for our babies are a whole world that is full of imagination and life and as if taken from the fairytale world.&lt;/p&gt;&lt;p&gt;Wall decals for a nursery room should be delicate in combination with floral and floral figures with colorful hues.&lt;/p&gt;&lt;p&gt;The advantage of using the wall stickers for a nursery as a design and inspirational object is very informed, as the wall stickers can fill the nursery with a charming and vibrant atmosphere at a very reasonable and exaggerated cost. The result of designing a nursery room with wall stickers is the result of changing the room space by 180 degrees and turning it into a room full of a wonderful, enriching and unique atmosphere.&lt;/p&gt;&lt;p&gt;It\'s hard to forget that the toddler is constantly looking at the wall sticker and the more details it has about it, the more time it will spend looking at it.&lt;/p&gt;&lt;p&gt;Baby wall stickers are made of environmentally friendly, high quality vinyl material. They are easy to attach and remove and do not damage the wall.&lt;/p&gt;&lt;p&gt;The wall stickers for a nursery can contain a variety of characters and hence also have the advantage, as this effectively brings the imagination world light and simple to the child\'s room and stimulates the imagination and enrichment.&lt;/p&gt;&lt;p&gt;They are available in several designs and sizes and when we choose a wall sticker we will consider whether it is a baby wall sticker or a baby girl wall sticker and whether the wall sticker characters fit the world of baby content we want to reveal.&lt;/p&gt;&lt;p&gt;As a rule, all baby room wall stickers are high-quality stickers that match the world of toddlers, stimulating the imagination and desire to look at the small details and especially the charming and lively atmosphere of the room.&lt;/p&gt;', 'Babies Room', '', ''),
(70, 5, 'חדר תינוקות', '&lt;div style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לחדר לתינוקות הן למעשה הפתרון העיצובי האידיאלי לחדר הקטנטנים שלנו. השראה לאווירה חיה בחדר הילדים היא עבודה מאוד מהנה ומהנה כשאתם משתמשים במדבקות קיר לחדר ילדים. מדבקות קיר לתינוקות שלנו הם עולם ומלוא שכולו דמיון וחיים וכמו נלקחים מעולם האגדות.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מדבקות קיר לחדר ילדים צריכות להיות עדינות בשילוב דמויות פרחוניות ופרחוניות עם גוונים צבעוניים.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;היתרון בשימוש במדבקות הקיר לחדר ילדים כחפץ עיצובי ומעורר השראה הוא מושכל מאוד, שכן מדבקות הקיר יכולות למלא את חדר הילדים באווירה מקסימה ותוססת בעלות סבירה מאוד. התוצאה של עיצוב חדר ילדים עם מדבקות קיר היא תוצאה של שינוי חלל החדר ב -180 מעלות והפיכתו לחדר מלא באווירה נהדרת, מעשירה וייחודית.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;קשה לשכוח שהפעוט בוחן כל העת את מדבקה לקיר וככל שיש יותר פרטים עליו, כך הוא יבזבז זמן רב יותר על ההתבוננות בו.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מדבקות קיר לתינוקות עשויות מחומר ויניל ידידותי לסביבה ואיכותי. הם קלים לחיבור והסרה ואינם פוגעים בקיר.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מדבקות קיר לחדר ילדים יכולות להכיל מגוון של דמויות ומכאן שיש להן גם את היתרון, שכן הדבר מביא למעשה את עולם הדמיון קל ופשוט לחדר הילד ומגרה את הדמיון וההעשרה.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;הם זמינים במספר עיצובים וגדלים וכאשר אנו בוחרים מדבקת קיר נשקול אם מדובר במדבקה לקיר תינוקת או מדבקת קיר לתינוק והאם סגנון מדבקת הקיר מתאימה לעולם תוכן התינוקות אותו אנו רוצים לחשוף.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl; &quot;&gt;ככלל, כל מדבקות קיר לחדר התינוקות הן מדבקות איכותיות התואמות את עולמם של הפעוטות, ומעוררות את הדמיון והרצון להתבונן בפרטים הקטנים ובעיקר באווירה המקסימה והתוססת של החדר.&lt;/div&gt;', 'Babies Room', '', ''),
(20, 1, 'Shop by Theme', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n', 'Shop by Theme', 'Shop by Theme', 'Shop by Theme'),
