(59, 1, 'Babies', '', 'babies', 'Babies', 'Babies'),
(34, 1, 'Gift Ideas', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n', 'Gift Ideas', 'Gift Ideas ', 'Gift Ideas '),
