(33, 1, 'Best Sellers', '', 'Best Sellers', 'Best Sellers', 'Best Sellers'),
(72, 6, 'Living-Room', '', 'Living-Room', '', ''),
(18, 1, 'Shop by Room', '&lt;p&gt;The ideal solution for designing your room wall stickers, because by means of wall stickers for the bedroom you can create an atmosphere where we want in the room space.&lt;/p&gt;&lt;p&gt;You can choose the wall stickers for the bedroom to suit and fit with the existing bedroom furniture in both color and style.&lt;/p&gt;&lt;p&gt;Bedroom wall stickers are stickers that can be easily pasted or removed without damage to the wall. In addition, the solution of using wall decals for the bedroom design is an inexpensive solution compared to other solutions and the use of wall decals for the bedroom even gives the result of a rich, elegant and inviting bedroom.&lt;/p&gt;&lt;p&gt;Wall stickers for bedroom are stickers made of high quality vinyl material that can be cleaned with a damp rag when needed.&lt;/p&gt;&lt;p&gt;All in all, the bedroom design using wall stickers for the bedroom is an ideal design solution, very impressive and with a wide variety of choices to choose from.&lt;/p&gt;&lt;p&gt;Choosing wall decals for the bedroom design is an intelligent and smart choice, and even with very high costs, which allows for a large number of choices in how to design the bedroom and compare the home to a rich and modern look.&lt;/p&gt;\r\n', 'Shop by Room', 'Shop by Room', 'Shop by Room'),
(61, 6, 'Animals', '&lt;p&gt;&lt;span style=&quot;text-align: center; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;A wonderful selection of animals for your wall! Select out of the many categories such as butterflies, owls, pets, horses, predators or sea life.&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Animals', 'Animals, animals, birds, dogs, cats, butterflies', 'Animals, animals, birds, dogs, cats, butterflies'),
(75, 5, 'מטבח', '&lt;p style=&quot;direction: rtl; text-align: center;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;עצב את המטבח שלך עם הוספה של מדבקת קיר נפלאה כדי ליצור תחושה משפחתית חמימה. ציטוט נפלא, מתכון או מדבקת קיר נחמדה עם פרחים, אוכל או ירקות. בתאבון!&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'מטבח', '', ''),
(66, 5, 'משפטים', '&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;ניתן להשתמש במדבקות קיר עם משפטים וציטוטים מוטיבציוניים במשרדים כדי לעודד את העובדים העובדים, לעודד ולהגביר את הפעילות והפרודוקטיביות.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מדבקות קיר עם משפטים וציטוטים מוטיבציוניים יכולים לשמש גם כדי לעורר חשיבה יצירתית וחשיבה מחוץ לקופסא ולהעברת מסר שאנחנו רוצים לילדינו ולאנשים סביבנו.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מדבקות קיר עם משפטים וציטוטים מוטיבציוניים מאפשרים לנו לראות את המסר באופן קבוע לנגד עינינו.&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;direction: rtl;&quot;&gt;מבחר גדול של מדבקות קיר עם משפטים בחנות המקוונת לאמנות הקירות שלנו. בחר את הגודל שלך ואת אחד הצבעים החיים שלנו. שלב עם זוהר באלמנטים הכהים, פרפרי תלת מימד ועוד!&lt;/div&gt;&lt;/div&gt;', 'Sentences', '', ''),
