(80, 5, 'אביזרים לבית', '&lt;p style=&quot;direction: rtl; &quot;&gt;&lt;span id=&quot;docs-internal-guid-661991b4-7fff-cfae-118e-1215c1a953a7&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;זה יכול להיות כל כך כיף לעצב את הבית ולהפוך אותו לנעים ונוח במקום בו תוכלו להירגע אחרי יום ארוך. במרכז למדבקות קיר תוכלו למצוא מדבקות קיר לעיצוב הבית הטוב ביותר. ומכיוון שאנו מספקים ממש לדלת ביתכם, עיצוב הבית לא יכול להיות יותר כיף וקל!&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Home Accessories', '', ''),
