(61, 1, 'Animals', '&lt;p&gt;&lt;span style=&quot;text-align: center; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;A wonderful selection of animals for your wall! Select out of the many categories such as butterflies, owls, pets, horses, predators or sea life.&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Animals', 'Animals, animals, birds, dogs, cats, butterflies', 'Animals, animals, birds, dogs, cats, butterflies'),
(26, 1, 'Flowers', '&lt;p&gt;&lt;span style=&quot;text-align: center; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot; style=&quot;&quot;&gt;Trees in the wind, blossoms or wonderful flowers. Here you will find many wall stickers&amp;nbsp;with plants and trees. From dandelions to trees, from blossoms to branches.&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Flowers', '', ''),
(76, 1, 'Quotes', '&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:0pt;&quot;&gt;&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Quote wall stickers and motivational sentences can be used in offices to inspire the working staff, encourage and increased activity and productivity.&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:0pt;&quot;&gt;&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Quote wall stickers and motivational sentences can also be used to inspire creative thinking and out-of-the-box thinking and convey a message we want to our children and the people around us.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span id=&quot;docs-internal-guid-ff5a229e-7fff-ca15-a9a5-13ff71f2c47b&quot;&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:0pt;&quot;&gt;&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Quote wall stickers and motivational sentences allow us to see the message regularly in front of our eyes.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:0pt;&quot;&gt;&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.38;margin-top:0pt;margin-bottom:0pt;&quot;&gt;&lt;span style=&quot;font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;text-align: center;&quot;&gt;&lt;font face=&quot;Arial&quot; style=&quot;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Large selection of Quotes in our online wall art shop. Select your size and one of our vivid colors. Combine with glow in the dark elements, 3D butterflies and more!&lt;/span&gt;&lt;/font&gt;&lt;/span&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;', 'Quotes', '', ''),
(77, 1, 'Shapes', '&lt;p&gt;stars, hearts, butterflies&lt;br&gt;&lt;/p&gt;', 'Shapes', '', ''),
(79, 1, 'Door Decal', '', 'Door Decal', '', ''),
(80, 1, 'Home Accessories', '&lt;p&gt;&lt;span id=&quot;docs-internal-guid-661991b4-7fff-cfae-118e-1215c1a953a7&quot;&gt;&lt;span style=&quot;font-size: 12pt; font-family: Arial; background-color: transparent; font-variant-numeric: normal; font-variant-east-asian: normal; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;It can be so much fun to decorate your home and to make it cozy and comfortable where you can relax after a long day. At stickers-center you\'ll find wall decorations, for your best home design. And because we deliver right to your door, decorating could not be more fun and easy!&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Home Accessories', '', ''),
(60, 5, 'בית', '&lt;p style=&quot;direction: rtl; &quot;&gt;&lt;span style=&quot;font-family: Arial; font-size: 16px; white-space: pre-wrap;&quot;&gt;זה יכול להיות כל כך כיף לעצב את הבית ולהפוך אותו לנעים ונוח במקום בו תוכלו להירגע אחרי יום ארוך. במרכז למדבקות קיר תוכלו למצוא מדבקות קיר לעיצוב הבית הטוב ביותר. ומכיוון שאנו מספקים ממש לדלת ביתכם, עיצוב הבית לא יכול להיות יותר כיף וקל!&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Home', '', ''),
