INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 6, 'Privacy Policy', '&lt;p&gt;\r\n	Privacy Policy&lt;/p&gt;\r\n', 'Privacy Policy', '', ''),
(6, 6, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', 'Delivery Information', '', ''),
(5, 6, 'Terms &amp; Conditions', '&lt;p&gt;\r\n	Terms &amp;amp; Conditions&lt;/p&gt;\r\n', 'Terms &amp; Conditions', '', ''),
(4, 6, 'About Us', '&lt;p&gt;Stickers-Center is an online shopping website selling quality wall-stickers at a fair price. &lt;/p&gt;&lt;p&gt;The owner of the business, Dvir Elimelech, is engaging in the flag of the business about the fairness of the price to the customer as well as the supply of good and high quality wall stickers that meet high standards of design and made of high quality materials. &lt;/p&gt;&lt;p&gt;Our love for wall stickers began a long time ago when we first had to decorate our own home, while we were searching for a comfortable yet&amp;nbsp; satisfying solution.&lt;/p&gt;&lt;p&gt;We soon realized that each room at our house looks and feel so much better if we add it a couple of wall stickers.&amp;nbsp;&lt;/p&gt;&lt;p&gt;This choice was such a success for us that we knew that we had to share this with more people.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;And here we are, 7 years later, serving hundreds of customers all over the world, helping you to make your living spaces look as you wish at an affordable cost.&lt;/p&gt;\r\n', 'About Us', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers'),
(5, 5, 'תקנון', '&lt;p&gt;\r\n	תקנון&lt;/p&gt;\r\n', 'תקנון', '', ''),
(3, 5, 'מדיניות פרטיות', '&lt;p&gt;\r\n	מדיניות פרטיות&lt;/p&gt;\r\n', 'מדיניות פרטיות', '', ''),
(6, 5, 'משלוחים והזמנות', '&lt;p&gt;\r\n	מידע בנושאי משלוחים והזמנות&lt;/p&gt;\r\n', 'משלוחים והזמנות', '', ''),
(4, 5, 'אודות', '&lt;p style=&quot;direction: rtl; &quot;&gt;המרכז למדבקות קיר הוא אתר קניות מקוון המוכר מדבקות קיר איכותיות במחיר הוגן.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;בעל העסק, דביר אלימלך, עוסק בדגל העסק סביב הגינות המחיר ללקוח וכן על אספקת מדבקות קיר איכותיות ואיכותיות העומדות בסטנדרטים גבוהים של עיצוב ואשר עשויות מחומרים באיכות גבוהה.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;האהבה שלנו למדבקות קיר החלה לפני זמן רב כאשר נאלצנו לראשונה לקשט את ביתנו, בזמן שחיפשנו פתרון נוח ועם זאת מספק.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;מהר מאוד נוכחנו לדעת שכל חדר בבית שלנו נראה ומרגיש כל כך טוב יותר אם נוסיף לו כמה מדבקות קיר.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;הבחירה הזו הייתה כה הצלחה עבורנו שידענו שאנחנו צריכים לחלוק את זה עם יותר אנשים.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;והנה אנחנו, כמעט עשור לאחר מכן, משרתים מאות לקוחות בכל רחבי העולם, ועוזרים לכם לגרום למרחבי המגורים שלכם להיראות כרצונכם בעלות משתלמת.&lt;/p&gt;\r\n', 'אודות', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers'),
(5, 1, 'Terms &amp; Conditions', '&lt;p&gt;\r\n	Terms &amp;amp; Conditions&lt;/p&gt;\r\n', 'Terms &amp; Conditions', '', ''),
(3, 1, 'Privacy Policy', '&lt;p&gt;\r\n	Privacy Policy&lt;/p&gt;\r\n', 'Privacy Policy', '', ''),
(6, 1, 'Delivery Information', '&lt;p&gt;\r\n	Delivery Information&lt;/p&gt;\r\n', 'Delivery Information', '', ''),
(4, 1, 'About Us', '&lt;p&gt;Stickers-Center is an online shopping website selling quality wall-stickers at a fair price. &lt;/p&gt;&lt;p&gt;The owner of the business, Dvir Elimelech, is engaging in the flag of the business about the fairness of the price to the customer as well as the supply of good and high quality wall stickers that meet high standards of design and made of high quality materials. &lt;/p&gt;&lt;p&gt;Our love for wall stickers began a long time ago when we first had to decorate our own home, while we were searching for a comfortable yet&amp;nbsp; satisfying solution.&lt;/p&gt;&lt;p&gt;We soon realized that each room at our house looks and feel so much better if we add it a couple of wall stickers.&amp;nbsp;&lt;/p&gt;&lt;p&gt;This choice was such a success for us that we knew that we had to share this with more people.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;And here we are, 7 years later, serving hundreds of customers all over the world, helping you to make your living spaces look as you wish at an affordable cost.&lt;/p&gt;\r\n', 'About Us', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers');
