INSERT INTO `oc_modification` (`modification_id`, `extension_download_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`) VALUES
(7, 0, 0, 'd_twig_manager', 'd_twig_manager', 'Dreamvention', '2.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_twig_manager</name>\n    <code>d_twig_manager</code>\n    <description>Adds support for twig templating engine</description>\n    <version>2.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n    <file path=\"system/engine/loader.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$template = new Template($this->registry->get(\'config\')->get(\'template_engine\'));]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            $template = new Template($this->registry->get(\'config\')->get(\'template_engine\'), $this->registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/template.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[public function __construct($adaptor) {]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($adaptor, $registry) {\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$this->adaptor = new $class();]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            $this->adaptor = new $class($registry);\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"system/library/template/twig.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[private $data = array();]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            private $registry = array();\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[public function __construct() {]]></search>\n            <add position=\"replace\"><![CDATA[\n            //d_twig_manager.xml\n            public function __construct($registry) {\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[\\Twig_Autoloader::register();]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            $this->registry = $registry;\n            ]]></add>\n        </operation>\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$this->twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $this->twig->addExtension(new \\Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n    <file path=\"catalog/controller/event/theme.php\">\n        <operation error=\"skip\" info=\"\">\n            <search><![CDATA[$twig = new \\Twig_Environment($loader, $config);]]></search>\n            <add position=\"after\"><![CDATA[\n            //d_twig_manager.xml\n            if (file_exists(DIR_SYSTEM . \'library/template/Twig/Extension/DTwigManager.php\')) {\n                $twig->addExtension(new Twig_Extension_DTwigManager($this->registry));\n            }\n            ]]></add>\n        </operation>\n    </file>\n</modification>', 0, '2019-09-16 17:13:00'),
(8, 0, 0, 'd_security_module', 'd_security_module', 'Dreamvention', '1.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_security_module</name>\n    <code>d_security_module</code>\n    <description>Sapphire - Security Module</description>\n    <version>1.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n\n    <file path=\"admin/controller/common/header.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[public function index() {]]></search>\n            <add position=\"after\"><![CDATA[\n            if ( (!empty($this->request->get[\'user_token\']) || !empty($this->request->get[\'token\']))\n            && isset($this->request->get[\'route\']) && strcmp($this->request->get[\'route\'], \'extension/module/d_security_module\')) {\n\n                // AWESOME\n                if (file_exists(dirname(DIR_TEMPLATE).\'/javascript/d_security_module/library/awesome/css/font-awesome.min.css\')) {\n                    $this->document->addStyle(\'view/javascript/d_security_module/library/awesome/css/font-awesome.min.css\');\n                } else { $this->document->addScript(\'https://use.fontawesome.com/70f81fc58b.js\'); }\n                $this->document->addStyle(\'view/javascript/d_security_module/library/awesome/css/v4-shims.min.css\');\n\n                $token = (VERSION >= \'3.0.0.0\') ? \'user_token=\'.$this->request->get[\'user_token\'] : \'token=\'.$this->request->get[\'token\'];\n\n                // SAPPHIRE\n                $protection_status = False;\n\n                if (file_exists(DIR_SYSTEM.\'library/d_security_module/d_security_module.php\')) {\n                    try {\n                        $core = new \\d_security_module\\d_security_module();\n                        $core->init_database();\n                        $protection_status = $core->get_store_status();\n                    } catch (Exception $e) {\n                        ////\n                    }\n                }\n\n                $sapphire = array(\n                    \'name\'              => \'Sapphire - security\',\n                    \'protected\'         => $protection_status,\n                    \'protection_text\'   => ($protection_status) ? \'Protected\' : \'Unprotected\',\n                    \'href\'              => $this->url->link(\'extension/module/d_security_module\', $token, \'SSL\')\n                );\n\n                $data[\'sapphire\'] = $sapphire;\n            }\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"admin/view/template/common/header.twig\">\n        <operation error=\"skip\">\n            <search><![CDATA[<ul class=\"nav navbar-nav navbar-right\">]]></search>\n            <add position=\"after\"><![CDATA[\n                <style>\n                  #sapphire,#sapphire i{color:rgb(67,235,171)}#sapphire{line-height:25px;font-size:17px;font-weight:500;cursor:pointer}#sapphire .sph_unprotected{color:#fa5b6d}\n                </style>\n                {% if sapphire is defined %}\n                <li id=\"sapphire\">\n                    <a href=\"{{ sapphire.href }}\" title=\"{{ sapphire.protection_text }} | {{ sapphire.name }}\"><i class=\"fa fa-diamond on fa-circle {% if not sapphire.protected %}sph_unprotected{% endif %}\" aria-hidden=\"true\"></i></a>\n                </li>\n                {% endif %}\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"admin/view/template/common/header.tpl\">\n        <operation error=\"skip\">\n            <search><![CDATA[<ul class=\"nav pull-right\">]]></search>\n            <add position=\"after\"><![CDATA[\n            <style>\n              #sapphire,#sapphire i{color:rgb(67,235,171)}#sapphire{line-height:18px;font-size:17px;font-weight:500;cursor:pointer}#sapphire .sph_unprotected{color:#fa5b6d}\n            </style>\n            <?php if(isset($sapphire) && $sapphire) { ?>\n            <li id=\"sapphire\">\n                <a href=\"<?php echo $sapphire[\'href\']; ?>\" title=\"<?php echo $sapphire[\'protection_text\']; ?> | <?php echo $sapphire[\'name\']; ?>\"><i class=\"fa fa-diamond on fa-circle <?php echo (!$sapphire[\'protected\']) ? \'sph_unprotected\' : \'\' ?>\" aria-hidden=\"true\"></i></a>\n            </li>\n            <?php } ?>\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"catalog/controller/common/footer.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[public function index() {]]></search>\n            <add position=\"after\"><![CDATA[\n                // SECURITY MODULE\n                $data[\'security_update_route\'] = $this->url->link(\'extension/module/d_security_module/check_for_shedule\', \'\', true);\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"catalog/view/theme/*/template/common/footer.twig\">\n        <operation error=\"skip\">\n            <search><![CDATA[</body>]]></search>\n            <add position=\"before\"><![CDATA[\n                <script type=\"text/javascript\">\n                    $(function(){$.post(\"{{ security_update_route }}\",function(t){})});\n                </script>\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"catalog/view/theme/*/template/common/footer.tpl\">\n        <operation error=\"skip\">\n            <search><![CDATA[</body>]]></search>\n            <add position=\"before\"><![CDATA[\n                <?php if (isset($security_update_route)) { ?>\n                <script type=\"text/javascript\">\n                    $(function(){$.post(\"<?php echo $security_update_route; ?>\",function(t){})});\n                </script>\n                <?php } ?>\n            ]]></add>\n        </operation>\n    </file>\n\n</modification>\n', 0, '2019-09-16 17:20:30'),
(9, 0, 0, 'd_security_module_firewall', 'd_security_module_firewall', 'Dreamvention', '1.0.0', 'http://dreamvention.com', '<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<modification>\n    <name>d_security_module_firewall</name>\n    <code>d_security_module_firewall</code>\n    <description>Sapphire - Firewall</description>\n    <version>1.0.0</version>\n    <author>Dreamvention</author>\n    <link>http://dreamvention.com</link>\n\n    <file path=\"system/engine/router.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[$this->registry = $registry;]]></search>\n            <add position=\"after\"><![CDATA[\n            // SECURITY MODULE FIREWALL\n            if (file_exists(DIR_SYSTEM.\'library/d_security_module/core/firewall.php\')) {\n                $fw = new \\d_security_module\\core\\firewall(array(\n                    \'db\'        => $this->registry->get(\'db\'),\n                    \'session\'   => $this->registry->get(\'session\'),\n                    \'request\'   => $this->registry->get(\'request\')\n                ));\n                $fw->check_routine();\n                unset($fw);\n            }\n            ]]></add>\n        </operation>\n    </file>\n\n    <file path=\"system/engine/front.php\">\n        <operation error=\"skip\">\n            <search><![CDATA[$this->registry = $registry;]]></search>\n            <add position=\"after\"><![CDATA[\n            // SECURITY MODULE FIREWALL\n            if (file_exists(DIR_SYSTEM.\'library/d_security_module/core/firewall.php\')) {\n                $fw = new \\d_security_module\\core\\firewall(array(\n                    \'db\'        => $this->registry->get(\'db\'),\n                    \'session\'   => $this->registry->get(\'session\'),\n                    \'request\'   => $this->registry->get(\'request\')\n                ));\n                $fw->check_routine();\n                unset($fw);\n            }\n            ]]></add>\n        </operation>\n    </file>\n\n\n\n</modification>\n', 0, '2019-09-16 17:20:30');
