;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Quantity: 1 Pcs&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Layout Size: 60*90cm&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Finished Size: 167*100cm&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Color: As picture show&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Function: Wall Sticker Decal&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Package Included:&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1 x Wall sticker&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;How to use:&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Choose a smooth, clean and dry surface. Peel the stickers from the sheet one by one&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Position the adhesive on a plane surface without pressing them, so that it let\'s possibility to withdraw them and reposition again,if needed.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If the result is satisfactory for you, stick firmly to the surface pressing the air bubbles outwards.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If you have bubbles, take a needle to bore them..&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Clean the smooth surface before sticking it on.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;margin-bottom: 0px; border: 0px;&quot;&gt;&lt;br style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;; font-size: medium; text-align: -webkit-center;&quot;&gt;&lt;/p&gt;', '', 'Pink Plum Flower Leaves Tree', '', ''),
