(100, 5, 'Around The World Map', '&lt;ul style=&quot;list-style: none; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Material: Plastic&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span data-spm-anchor-id=&quot;a2g0o.detail.1000023.i1.17e6798c8E6D5I&quot; style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Product typesetting size : Approx 60*90cm&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Conversion: 1 inch = 2.54 cm , 1 cm = 0.3937 inch&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;‘&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;Removable’&lt;/span&gt;&amp;nbsp;means that you can get rid of the sticker on the wall when you don’t want it on the anymore and it can be used again. Try to avoid sticking it for too many times, otherwise the stickiness might be declined.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&q