-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Note : 1. Size is free. The final size depend on your DIY design, in the picture we just give one or some sample show.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; color: rgb(255, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;2. Pictures may slightly vary from actual item due to lighting, and the color calibration of each individual monitor.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; color: rgb(0, 112, 192);&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Attention&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;1. When you receive the stickers, it will be wrinkled due to packing.Please don\\\'t use it at this time. Put it in flat place first, wait until the stickers opened and turn unfolded completely. This will keep the stickiness. Otherwise it wouldn\'t stick to wall.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div data-spm-anchor-id=&quot;a2g0o.detail.1000023.i0.17e6798c8E6D5I&quot; style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;2. You need to make sure the surface is clean and dry before you stick it. Any greasy dirt or water will influence the perfection of the sticker. Sometimes there might be some bubbles appear in big stickers, if this happens please remove the bubble or just pin it. When the wall is wet due to some unexpected reasons, it might have bad influences on the sticker, when this happens please dry the wall and the sticker with an air blower or simply stick it again when the wall is dry.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;', '', 'Around The World Map', '', ''),
