(123, 1, 'Winnie the Pooh with Friends', '&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Material: PVC&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; line-height: inherit;&quot;&gt;&lt;font face=&quot;Arial&quot; style=&quot;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Composing Size:30x60cm&amp;nbsp; 1 Sheets&amp;nbsp;Finished&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Photos are for illustration purposes only, please check indicated size, or choose different sizes in the store&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;The real size depends on the product. The pictures just offer a reference.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;HOW TO USE&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;It is not peel and stick decals. You need to use the transfer paper to stick it. Transfer paper is reusable and is together with the wall quote decal in the package. Please do it following the instructions&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.Choose a smooth,clean and dry surface. Peel the stickers from the sheet one by one.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.Position the adhesive on a plane surface without pressing them, so that it lets possibility to withdraw them and reposition again, if needed.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.If the result is satisfactory for you,stick firmly to the surface pressing the air bubbles outwards.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.If you have bubbles,take a needle to bore them.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 18px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word;&quot;&gt;&lt;span style=&quot;font-weight: 700 !important; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Package Included:&lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p data-spm-anchor-id=&quot;a2g0o.detail.1000023.i2.4d006d14XmoG99&quot; style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 18px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&amp;nbsp; - 1x Wall Sticker&lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Winnie the Pooh with Friends', '', '');
