(118, 1, '3D Black Plain Butterflies', '&lt;p&gt;Easy to Apply, Removable, Durable, Pressure Resistance, Shock Resistance, Moisture Resistance&lt;/p&gt;&lt;p&gt;Different shapes can be designed according to different preferences, beautify the walls, creating a variety of styles&lt;/p&gt;&lt;p&gt;Perfect design. Every package includes 4 size, 2pcs 12cm, 2pcs 10cm, 4pcs 8cm, 4pcs 6cm.&lt;/p&gt;&lt;p&gt;A perfect gift for any special occasions like Christmas, wedding, birthday, anniversary,engagement, new baby.&lt;/p&gt;&lt;p&gt;Condition: 100% Brand New.Unopened .Unused&lt;/p&gt;&lt;p&gt;Color Available: Pink&lt;/p&gt;&lt;p&gt;Size:As Picture Shown&lt;/p&gt;&lt;p&gt;Weight:app 30g&lt;/p&gt;&lt;p&gt;Material: PVC&lt;/p&gt;&lt;p&gt;Subjects:Animal&lt;/p&gt;&lt;p&gt;Functions:Decorative Wall Stickers&lt;/p&gt;&lt;p&gt;Style: Fashion/Leisure/DIY&lt;/p&gt;&lt;p&gt;Feature:Contain Magnet&lt;/p&gt;&lt;p&gt;A perfect gift for any special occasions like Christmas, wedding, birthday, anniversary,engagement, new baby.&lt;/p&gt;&lt;p&gt;Can be applied to all smooth surfaces like walls, doors, windows, mirrors, plastic, metal, furniture, tiles, vehicles etc.&lt;/p&gt;&lt;p&gt;Occasion:Kids Room, Hotels, Living Rooms, Bathroom, Bedrooms, Toilet, Nurseries, Stair, Offices, Lobby, Cafes&lt;/p&gt;&lt;p&gt;Garment care:Pls Keep away from children under 3 years old&lt;/p&gt;&lt;p&gt;Package Included:12 x Pink 3D Butterfly Wall Sticker (2pcs 12cm, 2pcs 10cm,4pcs 8cm,4pcs 6cm) and 1 pcs Jelly Glue&lt;/p&gt;&lt;p&gt;How to use:&lt;/p&gt;&lt;p&gt;1. Ensure the surface is smooth, do not stick on the rough or uneven surface.&lt;/p&gt;&lt;p&gt;2. Choose the place you want to apply, clean up the ash and grease, keep it dry and clean.&lt;/p&gt;&lt;p&gt;3. Use Blue-Tack as show in the picture and stick the butterfly to the place you want them be.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Package: 12pcs(small: 16 pcs, medium: 4 pcs, large: 4 pcs) Include tape. Size(width): S-2.56&quot;,M-3.15&quot;, L-4.33&quot;.&lt;/p&gt;&lt;p&gt;Easy to stick: apply to dry, clean and smooth surfaces; clean the place you want to stick the butterfly, just peel the paper on the butterfly, paste them, and make sure their wings lift up.&lt;/p&gt;&lt;p&gt;Good decoration gadgets: they can be applied to decor a theme party, butterfly museum embellishment, children room, garden parties, photography background, Christmas, wedding, birthday, etc.&lt;/p&gt;&lt;p&gt;Use for a long time: butterfly wall decals is made of PVC material, durable, anti-dust, convenient for you to clean which can make the butterfly last longer.&lt;/p&gt;&lt;p&gt;100% money back guarantee：When you order our 3D Butterfly Wall Decals today, you\'re protected by a 60 day, no-questions asked money back guarantee. TOTALLY RISK FREE, why not give it a try .&lt;/p&gt;', '', '3D Black Plain Butterflies', '', ''),
(119, 1, '3D Black &amp; White Art Butterflies', '&lt;p style=&quot;text-align: left; margin-bottom: 0px; font-size: 14px; line-height: inherit;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot; style=&quot;&quot;&gt;100% Brand New and High Quality&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Environmentally friendly material&lt;/font&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Can be placed in outdoor / garden / balcony.&lt;/font&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Made with film print which is not afraid of wind and rain and does not change color for a long time.&lt;/font&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Randomly spreading angle wings after being folded.&lt;/font&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Can be used for home decoration, shop window displays, wedding marriage room and so on.&lt;/font&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: left; box-sizing: content-box; font-size: