(74, 6, 'Creative Cute Rainbow Unicorn With Colorful Hearts', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Material: PVC&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Color: Colorful(as pictures show)&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Size: 36 x 60cm/14.0 x 24.0 inches&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Product Description:&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Cartoon Style Wall Stickers for Home Decoration.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Beautiful pink wall decals feature a animal pattern and stars design.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Easy to apply and remove without leaving any residue. Not suitable for dirty or rough surface.&lt;/span&gt;&lt;br style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif; font-size: small;&quot;&gt;Suitable for bedrooms, living rooms, playing rooms, nurseries and home decor.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Creative Cute Rainbow Unicorn With Colorful Hearts', 'Unicorn', ''),
(77, 6, 'Ice Cream Sweet Wall Art Sticker', '&lt;ul class=&quot;a-unordered-list a-vertical a-spacing-none&quot; style=&quot;margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(17, 17, 17); padding: 0px; font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif;&quot;&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Completed Reference Size: 60*70 CM; Package Size: 30*90 CM (DIY Collage)&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;High Quality Material---Decals made of high quality PVC/Vinyl Material; Odor-free environment; Harmless; Please feel at ease to use&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Easy to Install and Removable---No need to cut, can be tear off directly then pasted; this decal is no the white side, so you can paste it on any color surface; Imported green plastic, easy to remove and not to hurt the wall&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Applicable Surface---Painted walls, Tile, Metal, Polished Wood, Plastic and other Smooth Surfaces. Not available in severe peeling off the gray walls, obviously uneven walls&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Wide Range Of Applications --- Living Room, Sofa, TV Wall, Children\'S Room, Bedroom, Study, Entrance Hallway, Closet Doors, Glass Windows Doors etc. Fine quality, full color pattern which give bring the different visual feeling in room, not the blank wall again&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;', '', 'Ice Cream Sweet Wall Art Sticker', '', ''),
(125, 6, 'Pink Plum Flower Leaves Tree', '&lt;h3 align=&quot;left&quot; style=&quot;margin-right: 0px; margin-bottom: 0px; margin-left: 0px; border: 0px;&quot;&gt;&lt;span style=&quot;margin: 0px; border: 0px;&quot;&gt;&lt;p style=&quot;margin-bottom: 0px; border: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;High quality!Brand new100%!&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Material:Non Toxic PVC which is removable without residue remaining on the surface.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Non-toxic, environmental protection, waterproof.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;DIY facilitate easier, richer color pattern. Just peel and stick and give your house wall a change.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;This product can be directly attached to the walls, ceramics, glass,window,furniture,mirror,car...any flat even smooth surfaces.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;DIY for your lovely and elegant Room,it will be beautiful, dream house and love house.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;You can easily become your home decoration designers.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Feature:a contemporary way to complement your home or business interior design. Self-adhesive, water resistant and removable,&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;suitable for most flat smooth surfaces without leaving residue,however a pre-test is highly recommended.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Note:As the sticker is big, so we will ship it fold.Thanks for you understand.&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Description:&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Material: PVC&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Quantity: 1 Pcs&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Layout Size: 60*90cm&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Finished Size: 167*100cm&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Color: As picture show&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Function: Wall Sticker Decal&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Package Included:&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1 x Wall sticker&lt;/span&gt;&lt;br&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;How to use:&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Choose a smooth, clean and dry surface. Peel the stickers from the sheet one by one&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Position the adhesive on a plane surface without pressing them, so that it let\'s possibility to withdraw them and reposition again,if needed.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If the result is satisfactory for you, stick firmly to the surface pressing the air bubbles outwards.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;If you have bubbles, take a needle to bore them..&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Clean the smooth surface before sticking it on.&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;/span&gt;&lt;/h3&gt;&lt;p style=&quot;margin-bottom: 0px; border: 0px;&quot;&gt;&lt;br style=&quot;font-family: &amp;quot;Times New Roman&amp;quot;; font-size: medium; text-align: -webkit-center;&quot;&gt;&lt;/p&gt;', '', 'Pink Plum Flower Leaves Tree', '', '');
