(120, 6, '3D Romantic Rose Flowers', '&lt;p&gt;Material: PVC Vinyl&lt;br&gt;&lt;/p&gt;&lt;p&gt;Compatible:&lt;/p&gt;&lt;p&gt;Ideal for Family Lounge, Bedroom, Cafe and Restaurant, Kids room, Nursery Room etc.&lt;/p&gt;&lt;p&gt;Features:&lt;/p&gt;&lt;p&gt;PVC, Non-toxic, Eco-friendly, Waterproof. These wall stickers decorate your home just in minutes.&lt;/p&gt;&lt;p&gt;Wall Sticker Application Instruction&lt;/p&gt;&lt;p&gt;Our wall decal application instructions will make it easy for you to apply your wall decals.&lt;/p&gt;&lt;p&gt;1). The surface you wish to attach your decal must be clean and free from dust, grease or any other contamination.&lt;/p&gt;&lt;p&gt;2). Simply peel those pre-cut pieces of wall stickers off from the backing paper and apply them to the desired area.&lt;/p&gt;&lt;p&gt;Refer to the finished design shown in between the sheet and follow the numbers mentioned on the pieces to form the desired pattern.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Freshly painted or lacquered surfaces must be allowed to completely cure for minimum 30 days before the decal is applied.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;3). After pasting the wall stickers on your wall, press firmly along the border and remove air bubbles if any. Repeat, if required.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;4). DO NOT APPLY ON WET WALLS&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;It will be helpful and fun if you take help of your friends or family members! :)&lt;/p&gt;', '', '3D Romantic Rose Flowers', '', ''),
(121, 6, 'Cartoon Sailboat Submarine Underwater Fish', '&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;1. Easy to apply, remove, reposition, and reuse without leaving damage or residue.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;2. With little cost or effort you can decorate your home without the trouble or expense of painting.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;3. The professional designed colour conbination makes it more compatible with any wall colour&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;4. Show your creativity by turning your wall into a beautiful work of art with wall art decals.it\'s simple to stick on the wall and easy to remove.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;5. can be applied on most flat surfaces, including windows, mirrors, or any smooth surfaces. They can also be applied on your vehicle.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Cartoon Sailboat Submarine Underwater Fish', '', ''),
(90, 6, 'Peach Blossom Flowers ', '&lt;p&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-weight: 700 !important;&quot;&gt;Features:&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;Instantly removable, repositionable and reusable, with no harm or damage to the surface.&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;Can be placed on the wall, fridge, tile and any other hard surface places.&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;No measuring, no cutting, just peel and stick.&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-weight: 700 !important;&quot;&gt;Attention:&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;You need to make sure the surface is clean and dry before you stick it. Any greasy dirt or water will influence the perfection of the sticker. Sometimes there might be some bubbles appear in big stickers, if this happens please remove the bubble or just pin it. When the wall is wet due to some unexpected reasons, it might have bad influences on the sticker, when this happens please dry the wall and the sticker with an air blower or simply stick it again when the wall is dry.&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px; font-weight: 700 !important;&quot;&gt;Specifications:&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;Material: PVC&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;Sheet size: 60 * 45cm / 23.6 * 17.7in&lt;/span&gt;&lt;br style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-family: Arial, Helvetica, sans-serif; font-size: 14px;&quot;&gt;Sheet weight: 95g / 3.4oz&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', '', 'Peach Blossom Flowers ', '', ''),
