17, 17, 17);&quot;&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px; color: rgb(17, 17, 17);&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2 sheets of 23.6 inches x 35 inches Wall Stickers&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px; color: rgb(17, 17, 17);&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px;&quot;&gt;&lt;font color=&quot;#111111&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Made from Removable Self-adhesive PVC&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px;&quot;&gt;&lt;font color=&quot;#111111&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Home improvement wall treatments &amp;amp; supplies for bedroom living Room Home Office School&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px;&quot;&gt;&lt;/p&gt;&lt;p class=&quot;a-spacing-base&quot; style=&quot;padding: 0px; margin-top: -4px; margin-bottom: 0px;&quot;&gt;&lt;font color=&quot;#111111&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Easy to apply just peel and stick&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'Romantic White European Flowers', '', ''),
(76, 6, 'Mini Silver Stars', '&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Make sure this fits by entering your model number.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Material: PVC&lt;/span&gt;&lt;br style=&quot;font-size: small; color: rgb(51, 51, 51); font-family: &amp;quot;Amazon Ember&amp;quot;, Arial, sans-serif;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Total Contain: Set of 132pcs Silver/Gold stars stickers includes 36pcs - 3” silver star stickers; 36pcs - 2” silver star stickers; 60 - 1” silver star stickers&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Safe and removable on painted wall or any smooth, flat, dry and dust free surface so you don’t need to worry about damaging wall paints&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Easy to peel and stick vinyl wall decals, no tools required to install the silver stars wall decals&lt;/span&gt;&lt;/p&gt;', '', 'Mini Silver Stars', '', '');
