(100, 6, 'Around The World Map', '&lt;ul style=&quot;list-style: none; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Material: Plastic&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span data-spm-anchor-id=&quot;a2g0o.detail.1000023.i1.17e6798c8E6D5I&quot; style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Product typesetting size : Approx 60*90cm&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Conversion: 1 inch = 2.54 cm , 1 cm = 0.3937 inch&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;‘&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;Removable’&lt;/span&gt;&amp;nbsp;means that you can get rid of the sticker on the wall when you don’t want it on the anymore and it can be used again. Try to avoid sticking it for too many times, otherwise the stickiness might be declined.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;You can have your kids help you put up the stickers so they can enjoy the fun of personalizing their very own room,also can serve as an eye-catching decoration.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;The sticker can be placed on the wall, fridge, tile and any other hard surface places.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;You can put the stickers in your own order whatever it might be.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;margin-left: 0px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;You can lift it gently with a sharp tool like knives and stick it somewhere else, it can be used for many times if used properly.&lt;/span&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti;&quot;&gt;&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; color: rgb(255, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Note : 1. Size is free. The final size depend on your DIY design, in the picture we just give one or some sample show.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;margin-bottom: 0px; font-size: 14px; line-height: inherit; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; color: rgb(255, 0, 0);&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;2. Pictures may slightly vary from actual item due to lighting, and the color calibration of each individual monitor.&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&amp;nbsp;&lt;/div&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;font-weight: 700 !important;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; color: rgb(0, 112, 192);&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;Attention&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;1. When you receive the stickers, it will be wrinkled due to packing.Please don\\\'t use it at this time. Put it in flat place first, wait until the stickers opened and turn unfolded completely. This will keep the stickiness. Otherwise it wouldn\'t stick to wall.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;&lt;div data-spm-anchor-id=&quot;a2g0o.detail.1000023.i0.17e6798c8E6D5I&quot; style=&quot;box-sizing: content-box; font-family: &amp;quot;Open Sans&amp;quot;, Arial, Helvetica, sans-serif, Heiti; font-size: 14px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-size: 16px;&quot;&gt;&lt;span style=&quot;max-width: 100%; word-break: break-word; font-family: arial, helvetica, sans-serif;&quot;&gt;2. You need to make sure the surface is clean and dry before you stick it. Any greasy dirt or water will influence the perfection of the sticker. Sometimes there might be some bubbles appear in big stickers, if this happens please remove the bubble or just pin it. When the wall is wet due to some unexpected reasons, it might have bad influences on the sticker, when this happens please dry the wall and the sticker with an air blower or simply stick it again when the wall is dry.&lt;/span&gt;&lt;/span&gt;&lt;/div&gt;', '', 'Around The World Map', '', '');
