(101, 6, 'Colorful Cute Mickey Mouse Shape', '&lt;p style=&quot;box-sizing: content-box; margin-bottom: 0px; line-height: inherit; padding: 0px; border: 0px; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-weight: inherit; font-size: 16px; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;span style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-weight: inherit; font-size: inherit; line-height: inherit; vertical-align: baseline;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span data-spm-anchor-id=&quot;a2g0o.detail.1000023.i7.69515321HbEC3r&quot; style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-size: 14px;&quot;&gt;Decorate interior walls, windows, and furniture and will adhere to most hard, smooth, clean surfaces such as mirrors, metal, wood, and walls.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-size: 14px;&quot;&gt;Easy to apply, remove, reposition, and reuse without leaving damage or residue.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-size: 14px;&quot;&gt;Ideal for dry, clean, and smooth surfaces.&lt;/span&gt;&lt;br&gt;&lt;span style=&quot;box-sizing: content-box; max-width: 100%; word-break: break-word; margin: 0px; padding: 0px; border: 0px; vertical-align: baseline; color: rgb(68, 68, 68); font-size: 14px;&quot;&gt;You could even make a DIY craft item by placing on a tile or painted