(78, 6, 'Colorful Multi-size Stars', '&lt;ul class=&quot;a-unordered-list a-vertical a-spacing-none&quot; style=&quot;margin-right: 0px; margin-bottom: 0px; margin-left: 18px; color: rgb(17, 17, 17); padding: 0px;&quot;&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Material: Self Adhesive Vinyl.&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Set of 123 white stars- 2.2&quot;- 27 stars; 1.8&quot;- 30 stars; 1&quot;- 60 stars 4.4&quot;-6 stars&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Safe and removable on painted wall or any smooth, flat, dry and dust free surface so you don’t need to worry about damaging wall paints&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Easy to peel and stick vinyl wall decals, no tools required to install the stars wall decals&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;li style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Works great for decorating apartments, kids rooms or nursery and so on.&lt;/font&gt;&lt;/span&gt;&lt;/li&gt;&lt;/ul&gt;', '', 'Colorful Multi-size Stars', '', ''),
(64, 6, 'Flower Boxes &amp; Birds', '&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&amp;nbsp;Wall stickers is made of 100% new high quality PVC material is very environmentally friendly material.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Safety and environmental protection, non-toxic odor-free, suitable for family safe home space , Free DIY, easy self-adhesive design, installation, casual collage, arbitrarily cut , simple and modern style.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;Size:A,C,D:70x50 cm/27.5x19.6in,B:45x60 cm/17.7x23.6in,Easy to apply, removable, durable, pressure resistance, shock resistance, moisture resistance, use in TV setting wall , bedrooms, living rooms, playing rooms, study room and home decorations.&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'dream', 'Flower Boxes &amp; Birds', 'Flower Boxes &amp; Birds', 'Flower Boxes &amp; Birds'),
(81, 6, 'Glowing In The Dark Stars for Ceiling or Wall Stickers', '&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.5299999999999998;margin-left: 11pt;margin-top:0pt;margin-bottom:5pt;&quot;&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Super bright night glowing stars - long lenght of glow, self - adhesive stars &amp;amp; dots - turn your nursery into a magic galaxy. shine brighter and last longer.&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.5299999999999998;margin-left: 11pt;margin-top:0pt;margin-bottom:5pt;&quot;&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Best kids gift – glow-in-the-dark stars enchanting room space decorations - ideal for boys or girls. Easy way to turn a dull room into a romantic ambience of glowing universe full of stars.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.5299999999999998;margin-left: 11pt;margin-top:0pt;margin-bottom:5pt;&quot;&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Fairytale realm – many children are not comfortable falling asleep in the dark. Luminescent starts transform children’s playroom into fairy glossy realm. let your kids gaze at an illuminated stars.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.5299999999999998;margin-left: 11pt;margin-top:0pt;margin-bottom:5pt;&quot;&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Easy to apply &amp;amp; easy to remove – our self-adhesive wall murals stickers could be easily peel and stick to any flat, clean and non-textured surface &amp;amp; can be removable without damaging the surface.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p dir=&quot;ltr&quot; style=&quot;line-height:1.5299999999999998;margin-left: 11pt;margin-top:0pt;margin-bottom:5pt;&quot;&gt;&lt;span style=&quot;font-size: 14px; color: rgb(0, 0, 0); background-color: transparent; font-weight: 400; font-style: normal; font-variant: normal; text-decoration: none; vertical-align: baseline; white-space: pre-wrap;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Enhance children\'s educational needs &amp;amp; interests - use out stickers as educational toys. Begin study constellations, astronomy, planets, moon. Grow their imagination of undiscovered inhabited planets.&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px 0px 6px 14px; line-height: 17px;&quot;&gt;&lt;span id=&quot;docs-internal-guid-b6300222-7fff-1797-db6e-aae3684b74e0&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;', '', 'Mini Glow in The Dark Stars for Ceiling or Wall Stickers', '', ''),
