(122, 6, 'Large Family Photo Tree ', '&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;PVC material, Size: 45 x 60cm&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Be Your Own Decorator - No More Hiring Someone to Do It for You! Custom Decorating Any Room or Hallway in Your Home Has Never Been Easier&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Proudly Display Your Family\'s History with This Beautiful Family Tree Decal. Add Your Personal Touch by Adding Frames of Your Choice to Match Your Home\'s Style. A Great Conversation Starter for Family and Friends&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Easy to apply, remove, reposition, and reuse without leaving damage or residue&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Decorate interior walls or windows of home, bathroom, office, dorm, or store&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Beautiful Tree Wall Decals,Eco-friendly, Waterproof,Non-toxic decals - safe for your baby,waterproof&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Sheet Size:45X60cm, Finish reference picture size:100x120cm;The reference images are just for displaying its effect, and the real size please refer to the entity, and according to your room layout to apply&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Ease of removal and re-positioning without damaging paint,Display your family trees album gallery&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;This product can be directly attached to the walls, ceramics, glass, window, furniture, mirror, car...any flat even smooth surfaces&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot;&gt;Wonderful DIY decoration for your house, room, office, nursery, shop, restaurant, bar and everywhere&lt;/span&gt;&lt;/p&gt;', '', 'Large Family Photo Tree ', '', '');
