INSERT INTO `oc_theme` (`theme_id`, `store_id`, `theme`, `route`, `code`, `date_added`) VALUES
(6, 0, 'default', 'common/home', '{{ header }}\n&lt;div id=&quot;common-home&quot; class=&quot;container&quot;&gt;\n  &lt;div class=&quot;row&quot;&gt;{{ column_left }}\n    {% if column_left and column_right %}\n    {% set class = \'col-sm-6\' %}\n    {% elseif column_left or column_right %}\n    {% set class = \'col-sm-9\' %}\n    {% else %}\n    {% set class = \'col-sm-12\' %}\n    {% endif %}\n    &lt;div id=&quot;content&quot; class=&quot;{{ class }}&quot;&gt;{{ content_top }}{{ content_bottom }}&lt;/div&gt;\n    {{ column_right }}&lt;/div&gt;\n&lt;/div&gt;\n{{ footer }}', '2019-09-16 11:13:03'),
(3, 0, 'default', 'common/language', '{% if languages|length &gt; 1 %}\n&lt;div class=&quot;pull-left&quot;&gt;\n  &lt;form action=&quot;{{ action }}&quot; method=&quot;post&quot; enctype=&quot;multipart/form-data&quot; id=&quot;form-language&quot;&gt;\n    &lt;div class=&quot;btn-group&quot;&gt;\n      &lt;button class=&quot;btn btn-link dropdown-toggle&quot; data-toggle=&quot;dropdown&quot;&gt;\n      {% for language in languages %}\n      {% if language.code == code %} \n      &lt;img src=&quot;catalog/language/{{ language.code }}/{{ language.code }}.png&quot; alt=&quot;{{ language.name }}&quot; title=&quot;{{ language.name }}&quot;&gt;\n      {% endif %}\n      {% endfor %}\n      &lt;span class=&quot;hidden-xs hidden-sm hidden-md&quot;&gt;{{ text_language }}&lt;/span&gt;&amp;nbsp;&lt;i class=&quot;fa fa-caret-down&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n      &lt;ul class=&quot;dropdown-menu&quot;&gt;\n        {% for language in languages %}\n        &lt;li&gt;\n          &lt;button class=&quot;btn btn-link btn-block language-select&quot; type=&quot;button&quot; name=&quot;{{ language.code }}&quot;&gt;&lt;img src=&quot;catalog/language/{{ language.code }}/{{ language.code }}.png&quot; alt=&quot;{{ language.name }}&quot; title=&quot;{{ language.name }}&quot; /&gt; {{ language.name }}&lt;/button&gt;\n        &lt;/li&gt;\n        {% endfor %}\n      &lt;/ul&gt;\n    &lt;/div&gt;\n    &lt;input type=&quot;hidden&quot; name=&quot;code&quot; value=&quot;&quot; /&gt;\n    &lt;input type=&quot;hidden&quot; name=&quot;redirect&quot; value=&quot;{{ redirect }}&quot; /&gt;\n  &lt;/form&gt;\n&lt;/div&gt;\n{% endif %}\n', '2019-09-16 11:09:41'),
(4, 0, 'default', 'common/maintenance', '{{ header }}\n&lt;div id=&quot;common-maintenance&quot; class=&quot;container&quot;&gt;\n  &lt;div class=&quot;row&quot;&gt;\n    &lt;div class=&quot;col-12&quot;&gt;{{ message }}&lt;/div&gt;\n  &lt;/div&gt;\n&lt;/div&gt;\n{{ footer }}', '2019-09-16 11:12:44'),
(5, 0, 'default', 'common/search', '&lt;div id=&quot;search&quot; class=&quot;input-group&quot;&gt;\n  &lt;input type=&quot;text&quot; name=&quot;search&quot; value=&quot;{{ search }}&quot; placeholder=&quot;{{ text_search }}&quot; class=&quot;form-control input-lg&quot; /&gt;\n  &lt;span class=&quot;input-group-btn&quot;&gt;\n    &lt;button type=&quot;button&quot; class=&quot;btn btn-default btn-lg&quot;&gt;&lt;i class=&quot;fa fa-search&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n  &lt;/span&gt;\n&lt;/div&gt;', '2019-09-16 11:12:53'),
(17, 0, 'default', 'product/category', '{{ header }}\n&lt;div id=&quot;product-category&quot; class=&quot;container&quot;&gt;\n  &lt;ul class=&quot;breadcrumb&quot;&gt;\n    {% for breadcrumb in breadcrumbs %}\n    &lt;li&gt;&lt;a href=&quot;{{ breadcrumb.href }}&quot;&gt;{{ breadcrumb.text }}&lt;/a&gt;&lt;/li&gt;\n    {% endfor %}\n  &lt;/ul&gt;\n  &lt;div class=&quot;row&quot;&gt;{{ column_left }}\n    {% if column_left and column_right %}\n    {% set class = \'col-sm-6\' %}\n    {% elseif column_left or column_right %}\n    {% set class = \'col-sm-9\' %}\n    {% else %}\n    {% set class = \'col-sm-12\' %}\n    {% endif %}\n    &lt;div id=&quot;content&quot; class=&quot;{{ class }}&quot;&gt;{{ content_top }}\n      &lt;h2&gt;{{ heading_title }}&lt;/h2&gt;\n      {% if thumb or description %}\n      &lt;div class=&quot;row&quot;&gt; {% if thumb %}\n        &lt;div class=&quot;col-sm-2&quot;&gt;&lt;img src=&quot;{{ thumb }}&quot; alt=&quot;{{ heading_title }}&quot; title=&quot;{{ heading_title }}&quot; class=&quot;img-thumbnail&quot; /&gt;&lt;/div&gt;\n        {% endif %}\n        {% if description %}\n        &lt;div class=&quot;col-sm-10&quot;&gt;{{ description }}&lt;/div&gt;\n        {% endif %}&lt;/div&gt;\n      &lt;hr&gt;\n      {% endif %}\n      {% if categories %}\n      &lt;h3&gt;{{ text_refine }}&lt;/h3&gt;\n      {% if categories|length &lt;= 5 %}\n      &lt;div class=&quot;row&quot;&gt;\n        &lt;div class=&quot;col-sm-3&quot;&gt;\n          &lt;ul&gt;\n            {% for category in categories %}\n            &lt;li&gt;&lt;a href=&quot;{{ category.href }}&quot;&gt;{{ category.name }}&lt;/a&gt;&lt;/li&gt;\n            {% endfor %}\n          &lt;/ul&gt;\n        &lt;/div&gt;\n      &lt;/div&gt;\n      {% else %}\n      &lt;div class=&quot;row&quot;&gt;{% for category in categories|batch((categories|length / 4)|round(1, \'ceil\')) %}\n        &lt;div class=&quot;col-sm-3&quot;&gt;\n          &lt;ul&gt;\n            {% for child in category %}\n            &lt;li&gt;&lt;a href=&quot;{{ child.href }}&quot;&gt;{{ child.name }}&lt;/a&gt;&lt;/li&gt;\n            {% endfor %}\n          &lt;/ul&gt;\n        &lt;/div&gt;\n        {% endfor %}&lt;/div&gt;\n      &lt;br /&gt;\n      {% endif %}\n      {% endif %}\n      {% if products %}\n      &lt;div class=&quot;row&quot;&gt;\n        &lt;div class=&quot;col-md-2 col-sm-6 hidden-xs&quot;&gt;\n          &lt;div class=&quot;btn-group btn-group-sm&quot;&gt;\n            &lt;button type=&quot;button&quot; id=&quot;list-view&quot; class=&quot;btn btn-default&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_list }}&quot;&gt;&lt;i class=&quot;fa fa-th-list&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n            &lt;button type=&quot;button&quot; id=&quot;grid-view&quot; class=&quot;btn btn-default&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_grid }}&quot;&gt;&lt;i class=&quot;fa fa-th&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n          &lt;/div&gt;\n        &lt;/div&gt;\n        &lt;div class=&quot;col-md-3 col-sm-6&quot;&gt;\n          &lt;div class=&quot;form-group&quot;&gt;&lt;a href=&quot;{{ compare }}&quot; id=&quot;compare-total&quot; class=&quot;btn btn-link&quot;&gt;{{ text_compare }}&lt;/a&gt;&lt;/div&gt;\n        &lt;/div&gt;\n        &lt;div class=&quot;col-md-4 col-xs-6&quot;&gt;\n          &lt;div class=&quot;form-group input-group input-group-sm&quot;&gt;\n            &lt;label class=&quot;input-group-addon&quot; for=&quot;input-sort&quot;&gt;{{ text_sort }}&lt;/label&gt;\n            &lt;select id=&quot;input-sort&quot; class=&quot;form-control&quot; onchange=&quot;location = this.value;&quot;&gt;\n              \n              \n              \n              {% for sorts in sorts %}\n              {% if sorts.value == \'%s-%s\'|format(sort, order) %}\n              \n              \n              \n              &lt;option value=&quot;{{ sorts.href }}&quot; selected=&quot;selected&quot;&gt;{{ sorts.text }}&lt;/option&gt;\n              \n              \n              \n              {% else %}\n              \n              \n              \n              &lt;option value=&quot;{{ sorts.href }}&quot;&gt;{{ sorts.text }}&lt;/option&gt;\n              \n              \n              \n              {% endif %}\n              {% endfor %}\n            \n            \n            \n            &lt;/select&gt;\n          &lt;/div&gt;\n        &lt;/div&gt;\n        &lt;div class=&quot;col-md-3 col-xs-6&quot;&gt;\n          &lt;div class=&quot;form-group input-group input-group-sm&quot;&gt;\n            &lt;label class=&quot;input-group-addon&quot; for=&quot;input-limit&quot;&gt;{{ text_limit }}&lt;/label&gt;\n            &lt;select id=&quot;input-limit&quot; class=&quot;form-control&quot; onchange=&quot;location = this.value;&quot;&gt;\n              \n              \n              \n              {% for limits in limits %}\n              {% if limits.value == limit %}\n              \n              \n              \n              &lt;option value=&quot;{{ limits.href }}&quot; selected=&quot;selected&quot;&gt;{{ limits.text }}&lt;/option&gt;\n              \n              \n              \n              {% else %}\n              \n              \n              \n              &lt;option value=&quot;{{ limits.href }}&quot;&gt;{{ limits.text }}&lt;/option&gt;\n              \n              \n              \n              {% endif %}\n              {% endfor %}\n            \n            \n            \n            &lt;/select&gt;\n          &lt;/div&gt;\n        &lt;/div&gt;\n      &lt;/div&gt;\n      &lt;div class=&quot;row&quot;&gt; {% for product in products %}\n        &lt;div class=&quot;product-layout product-list col-xs-12&quot;&gt;\n          &lt;div class=&quot;product-thumb&quot;&gt;\n            &lt;div class=&quot;image&quot;&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;&lt;img src=&quot;{{ product.thumb }}&quot; alt=&quot;{{ product.name }}&quot; title=&quot;{{ product.name }}&quot; class=&quot;img-responsive&quot; /&gt;&lt;/a&gt;&lt;/div&gt;\n            &lt;div&gt;\n              &lt;div class=&quot;caption&quot;&gt;\n                &lt;h4&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;{{ product.name }}&lt;/a&gt;&lt;/h4&gt;\n                &lt;p&gt;{{ product.description }}&lt;/p&gt;\n                {% if product.price %}\n                &lt;p class=&quot;price&quot;&gt; {% if not product.special %}\n                  {{ product.price }}\n                  {% else %} &lt;span class=&quot;price-new&quot;&gt;{{ product.special }}&lt;/span&gt; &lt;span class=&quot;price-old&quot;&gt;{{ product.price }}&lt;/span&gt; {% endif %}\n                  {% if product.tax %} &lt;span class=&quot;price-tax&quot;&gt;{{ text_tax }} {{ product.tax }}&lt;/span&gt; {% endif %} &lt;/p&gt;\n                {% endif %}\n                {% if product.rating %}\n                &lt;div class=&quot;rating&quot;&gt; {% for i in 1..5 %}\n                  {% if product.rating &lt; i %} &lt;span class=&quot;fa fa-stack&quot;&gt;&lt;i class=&quot;fa fa-star-o fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;/span&gt; {% else %} &lt;span class=&quot;fa fa-stack&quot;&gt;&lt;i class=&quot;fa fa-star fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;i class=&quot;fa fa-star-o fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;/span&gt;{% endif %}\n                  {% endfor %} &lt;/div&gt;\n                {% endif %} &lt;/div&gt;\n              &lt;div class=&quot;button-group&quot;&gt;\n                &lt;button type=&quot;button&quot; onclick=&quot;cart.add(\'{{ product.product_id }}\', \'{{ product.minimum }}\');&quot;&gt;&lt;i class=&quot;fa fa-shopping-cart&quot;&gt;&lt;/i&gt; &lt;span class=&quot;hidden-xs hidden-sm hidden-md&quot;&gt;{{ button_cart }}&lt;/span&gt;&lt;/button&gt;\n                &lt;button type=&quot;button&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_wishlist }}&quot; onclick=&quot;wishlist.add(\'{{ product.product_id }}\');&quot;&gt;&lt;i class=&quot;fa fa-heart&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n                &lt;button type=&quot;button&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_compare }}&quot; onclick=&quot;compare.add(\'{{ product.product_id }}\');&quot;&gt;&lt;i class=&quot;fa fa-exchange&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n              &lt;/div&gt;\n            &lt;/div&gt;\n          &lt;/div&gt;\n        &lt;/div&gt;\n        {% endfor %} &lt;/div&gt;\n      &lt;div class=&quot;row&quot;&gt;\n        &lt;div class=&quot;col-sm-6 text-left&quot;&gt;{{ pagination }}&lt;/div&gt;\n        &lt;div class=&quot;col-sm-6 text-right&quot;&gt;{{ results }}&lt;/div&gt;\n      &lt;/div&gt;\n      {% endif %}\n      {% if not categories and not products %}\n      &lt;p&gt;{{ text_empty }}&lt;/p&gt;\n      &lt;div class=&quot;buttons&quot;&gt;\n        &lt;div class=&quot;pull-right&quot;&gt;&lt;a href=&quot;{{ continue }}&quot; class=&quot;btn btn-primary&quot;&gt;{{ button_continue }}&lt;/a&gt;&lt;/div&gt;\n      &lt;/div&gt;\n      {% endif %}\n      {{ content_bottom }}&lt;/div&gt;\n    {{ column_right }}&lt;/div&gt;\n&lt;/div&gt;\n{{ footer }} \n', '2019-09-16 11:49:32'),
(8, 0, 'default', 'product/search', '{{ header }}\n&lt;div id=&quot;product-search&quot; class=&quot;container&quot;&gt;\n  &lt;ul class=&quot;breadcrumb&quot;&gt;\n    {% for breadcrumb in breadcrumbs %}\n    &lt;li&gt;&lt;a href=&quot;{{ breadcrumb.href }}&quot;&gt;{{ breadcrumb.text }}&lt;/a&gt;&lt;/li&gt;\n    {% endfor %}\n  &lt;/ul&gt;\n  &lt;div class=&quot;row&quot;&gt;{{ column_left }}\n    {% if column_left and column_right %}\n    {% set class = \'col-sm-6\' %}\n    {% elseif column_left or column_right %}\n    {% set class = \'col-sm-9\' %}\n    {% else %}\n    {% set class = \'col-sm-12\' %}\n    {% endif %}\n    &lt;div id=&quot;content&quot; class=&quot;{{ class }}&quot;&gt;{{ content_top }}\n      &lt;h1&gt;{{ heading_title }}&lt;/h1&gt;\n      &lt;label class=&quot;control-label&quot; for=&quot;input-search&quot;&gt;{{ entry_search }}&lt;/label&gt;\n      &lt;div class=&quot;row&quot;&gt;\n        &lt;div class=&quot;col-sm-4&quot;&gt;\n          &lt;input type=&quot;text&quot; name=&quot;search&quot; value=&quot;{{ search }}&quot; placeholder=&quot;{{ text_keyword }}&quot; id=&quot;input-search&quot; class=&quot;form-control&quot; /&gt;\n        &lt;/div&gt;\n        &lt;div class=&quot;col-sm-3&quot;&gt;\n          &lt;select name=&quot;category_id&quot; class=&quot;form-control&quot;&gt;\n            &lt;option value=&quot;0&quot;&gt;{{ text_category }}&lt;/option&gt;\n            {% for category_1 in categories %}\n            {% if category_1.category_id == category_id %}\n            &lt;option value=&quot;{{ category_1.category_id }}&quot; selected=&quot;selected&quot;&gt;{{ category_1.name }}&lt;/option&gt;\n            {% else %}\n            &lt;option value=&quot;{{ category_1.category_id }}&quot;&gt;{{ category_1.name }}&lt;/option&gt;\n            {% endif %}\n            {% for category_2 in category_1.children %}\n            {% if category_2.category_id == category_id %}\n            &lt;option value=&quot;{{ category_2.category_id }