(11, 0, 'default', 'extension/module/information', '&lt;div class=&quot;sidebar&quot;&gt;\n  &lt;ul class=&quot;nav nav-tabs nav-stacked&quot;&gt;\n    {% for information in informations %}\n    &lt;li&gt;&lt;a href=&quot;{{ information.href }}&quot;&gt;{{ information.title }}&lt;/a&gt;&lt;/li&gt;\n    {% endfor %}\n    &lt;li&gt;&lt;a href=&quot;{{ contact }}&quot;&gt;{{ text_contact }}&lt;/a&gt;&lt;/li&gt;\n    &lt;li&gt;&lt;a href=&quot;{{ sitemap }}&quot;&gt;{{ text_sitemap }}&lt;/a&gt;&lt;/li&gt;\n  &lt;/ul&gt;\n&lt;/div&gt;\n', '2019-09-16 11:46:53'),
(12, 0, 'default', 'extension/module/account', '&lt;div class=&quot;list-group&quot;&gt;\n  {% if not logged %}\n  &lt;a href=&quot;{{ login }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_login }}&lt;/a&gt; &lt;a href=&quot;{{ register }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_register }}&lt;/a&gt; &lt;a href=&quot;{{ forgotten }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_forgotten }}&lt;/a&gt;\n  {% endif %}\n  &lt;a href=&quot;{{ account }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_account }}&lt;/a&gt;\n  {% if logged %}\n  &lt;a href=&quot;{{ edit }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_edit }}&lt;/a&gt; &lt;a href=&quot;{{ password }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_password }}&lt;/a&gt;\n  {% endif %}\n  &lt;a href=&quot;{{ address }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_address }}&lt;/a&gt; &lt;a href=&quot;{{ wishlist }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_wishlist }}&lt;/a&gt; &lt;a href=&quot;{{ order }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_order }}&lt;/a&gt; &lt;a href=&quot;{{ download }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_download }}&lt;/a&gt;&lt;a href=&quot;{{ recurring }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_recurring }}&lt;/a&gt; &lt;a href=&quot;{{ reward }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_reward }}&lt;/a&gt; &lt;a href=&quot;{{ return }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_return }}&lt;/a&gt; &lt;a href=&quot;{{ transaction }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_transaction }}&lt;/a&gt; &lt;a href=&quot;{{ newsletter }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_newsletter }}&lt;/a&gt;\n  {% if logged %}\n  &lt;a href=&quot;{{ logout }}&quot; class=&quot;list-group-item&quot;&gt;{{ text_logout }}&lt;/a&gt;\n  {% endif %}\n&lt;/div&gt;\n', '2019-09-16 11:47:48'),
(13, 0, 'default', 'extension/module/divido_calculator', '&lt;script src=&quot;{{ merchant_script }}&quot;&gt;&lt;/script&gt;\n&lt;style&gt;\n.divido-calculator {\n	padding:10px 20px 20px 20px;\n	text-shadow:none;\n	-webkit-box-shadow: rgba(0, 0, 0, 0.2) 0 1px 2px 0, rgba(0, 0, 0, 0.05) 0 0 0 5px;\n	-moz-box-shadow: rgba(0, 0, 0, 0.2) 0 1px 2px 0, rgba(0, 0, 0, 0.05) 0 0 0 5px;\n	-ms-box-shadow: rgba(0, 0, 0, 0.2) 0 1px 2px 0, rgba(0, 0, 0, 0.05) 0 0 0 5px;\n	-o-box-shadow: rgba(0, 0, 0, 0.2) 0 1px 2px 0, rgba(0, 0, 0, 0.05) 0 0 0 5px;\n	box-shadow: rgba(0, 0, 0, 0.2) 0 1px 2px 0, rgba(0, 0, 0, 0.05) 0 0 0 5px;\n	-webkit-border-radius: 5px;\n	-moz-border-radius: 5px;\n	-ms-border-radius: 5px;\n	-o-border-radius: 5px;\n	border-radius: 5px;\n	border: 1px solid #555;\n	border-color: #d9d7ce #c8c6c1 #B0AEA6;\n	margin:20px;\n}\n\n#divido-checkout {\n	margin:0px;\n}\n\n.divido-calculator h1 {\n    color: white;\n    font-size: 24px;\n}\n\n@media screen and (min-width: 550px) {\n    .divido-calculator h1 {\n        font-size: 33px;\n    }\n}\n\n.divido-calculator dl {\n	width: 100%;\n	overflow: hidden;\n	padding: 0;\n	margin: 0\n}\n\n.divido-calculator dt,.divido-calculator dd {\n	float: left;\n	padding: 2px 0px;\n	margin: 0\n}\n\n\n.divido-calculator &gt; dl &gt; dt, .divido-calculator &gt; dl &gt; dd {\n    min-width: 150px;\n}\n\n.divido-calculator &gt; dl &gt; dt, .divido-calculator &gt; dl &gt; dd {\n    width: 100%;\n}\n\n.divido-calculator &gt; dl &gt; dt {\n    margin-bottom: 20px;\n}\n\n@media screen and (min-width: 960px) {\n    .divido-calculator &gt; dl &gt; dt, .divido-calculator &gt; dl &gt; dd {\n        width: 50%;\n    }\n\n    .divido-calculator &gt; dl &gt; dt {\n        margin-bottom: auto;\n    }\n}\n\n.divido-calculator div.divido-info dl dt, .divido-calculator div.divido-info dl dd {\n    width: 100%;\n}\n.divido-calculator div.divido-info dl dd {\n    padding-left: 5px;\n}\n@media screen and (min-width: 350px) {\n    .divido-calculator div.divido-info dl dt {\n        width: 70%;\n    }\n    .divido-calculator div.divido-info dl dd {\n        width: 30%;\n    }\n}\n@media screen and (min-width: 450px) {\n    .divido-calculator div.divido-info dl dt, .divido-calculator div.divido-info dl dd {\n        width: 50%;\n    }\n}\n@media screen and (min-width: 550px) {\n    .divido-calculator div.divido-info dl dt {\n        width: 40%;\n    }\n    .divido-calculator div.divido-info dl dd {\n        width: 60%;\n    }\n}\n\n@media screen and (min-width: 1080px) {\n	.divido-calculator div.divido-info dl dt {\n		width: 30%;\n	}\n	.divido-calculator div.divido-info dl dd {\n		width: 70%;\n	}\n}\n\n.divido-calculator input[type=range]{\n	-webkit-appearance: none;\n	display:inline-block;\n	width:80%;\n	border:0px;\n	padding:0px;\n}\n\n@media screen and (min-width: 450px) {\n    .divido-calculator input[type=range]{\n	    width:85%;\n    }\n}\n\n@media screen and (min-width: 550px) {\n    .divido-calculator input[type=range]{\n	    width:90%;\n    }\n}\n\n.divido-calculator select {\n	text-transform: none;\n	width: 100%;\n}\n\n@media screen and (min-width: 960px) {\n    .divido-calculator select {\n        width: 80%;\n    }\n}\n\n.divido-calculator div.description {\n	font-size:13px;\n	margin-top:15px;\n	margin-bottom:20px;\n}\n\n.divido-calculator .divido-info {\n	-webkit-border-radius: 5px;\n	-moz-border-radius: 5px;\n	-ms-border-radius: 5px;\n	-o-border-radius: 5px;\n	border-radius: 5px;\n}\n\n.divido-calculator .divido-deposit span {\n	display:inline-block;\n	margin-left:4px;\n	line-height:15px;\n	vertical-align:top;\n}\n\n.divido-calculator input[type=range]::-webkit-slider-runnable-track {\n	height: 5px;\n	border: none;\n	border-radius: 3px;\n}\n\n.divido-calculator label {\n	display:block;\n	clear:both;\n	font-weight:bold;\n}\n\n.divido-calculator input[type=range]::-webkit-slider-thumb {\n	-webkit-appearance: none;\n	border: none;\n	height: 16px;\n	width: 16px;\n	border-radius: 50%;\n	margin-top: -4px;\n}\n\n.divido-calculator input[type=range]:focus {\n	outline: none !important;\n	border:0px !important;\n}\n\n.divido-calculator .divido-logo {\n	width: 140px;\n	height: 42px;\n	display: block;\n	font-size: 20px;\n	line-height: 1;\n	text-indent: -9999px;\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-black-140x42.png\');\n	background-repeat: no-repeat;\n	background-size: cover;\n}\n\n.divido-calculator .divido-logo-sm {\n	width: 75px;\n	height: 23px;\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-black-75x23.png\');\n}\n\n.divido-calculator .divido-info {\n	padding:20px;\n}\n\n\n/* 			*/\n\n.divido-them-light .divido-info {\n	background:#f9f9f9;\n}\n\n.divido-theme-light a.divido-logo {\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-blue-140x42.png\');\n}\n.divido-theme-light a.divido-logo-sm {\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-blue-75x23.png\');\n}\n\n.divido-theme-light {\n	background-color:#fff;\n	color:#3E4F8B;\n}\n\n.divido-theme-light p {\n	color:#3E4F8B !important;\n}\n\n.divido-theme-light input[type=range]:focus::-webkit-slider-runnable-track {\n	background: #ccc;\n}\n\n.divido-theme-light input[type=range] {\n	background-color:transparent;\n}\n\n.divido-theme-light input[type=range]::-webkit-slider-runnable-track {\n	background: #999;\n}\n\n.divido-theme-light input[type=range]::-webkit-slider-thumb {\n	background: #3E4F8B;\n}\n\n\n/* 			*/\n\n.divido-theme-blue .divido-info {\n	background:#f9f9f9;\n	color:#000;\n}\n\n.divido-theme-blue a.divido-logo {\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-white-140x42.png\');\n}\n\n.divido-theme-blue a.divido-logo-sm {\n	background-image:url(\'//content.divido.com.s3-eu-west-1.amazonaws.com/images/logo-white-75x23.png\');\n}\n\n.divido-theme-blue {\n	background-color:#3E4F8B;\n	color:#fff;\n}\n\n.divido-theme-blue p {\n	color:#fff !important;\n}\n\n.divido-theme-blue input[type=range]:focus::-webkit-slider-runnable-track {\n	background: #ccc;\n}\n\n.divido-theme-blue input[type=range] {\n	background-color:transparent;\n}\n\n.divido-theme-blue input[type=range]::-webkit-slider-runnable-track {\n	background: #999;\n}\n\n.divido-theme-blue input[type=range]::-webkit-slider-thumb {\n	background: #fff;\n}\n\n\n.divido-btn {\n	-webkit-border-radius: 4	;\n    -moz-border-radius: 4;\n    border-radius: 4px;\n    font-family: Arial;\n    color: #ffffff;\n    font-size: 11px;\n    background: #3E4F8B;\n    padding: 3px 7px 5px 7px !important;\n    text-decoration: none;\n    border:1px solid #296AB3;\n}\n\n.divido-btn :hover {\n    background: #3cb0fd;\n    background-image: -webkit-linear-gradient(top, #3cb0fd, #3498db);\n    background-image: -moz-linear-gradient(top, #3cb0fd, #3498db);\n    background-image: -ms-linear-gradient(top, #3cb0fd, #3498db);\n    background-image: -o-linear-gradient(top, #3cb0fd, #3498db);\n    background-image: linear-gradient(to bottom, #3cb0fd, #3498db);\n    text-decoration: none;\n}\n\n.divido-widget img {\n    display: inline-block;\n}\n\n.divido-calculator select {\n        color: #000;\n}\n&lt;/style&gt;\n&lt;div id=&quot;divido-checkout&quot; data-divido-calculator class=&quot;divido-calculator divido-theme-blue&quot; data-divido-amount=&quot;{{ product_price }}&quot; data-divido-plans=&quot;{{ plan_list }}&quot;&gt;\n    &lt;h1&gt;\n        &lt;a href=&quot;https://www.divido.com&quot; target=&quot;_blank&quot; class=&quot;divido-logo divido-logo-sm&quot; style=&quot;float:right;&quot;&gt;Divido&lt;/a&gt;\n        {{ text_checkout_title }}\n    &lt;/h1&gt;\n    &lt;div style=&quot;clear:both;&quot;&gt;&lt;/div&gt;\n    &lt;dl&gt;\n        &lt;dt&gt;&lt;span data-divido-choose-finance data-divido-label=&quot;{{ text_choose_plan }}&quot; data-divido-form=&quot;divido_finance&quot;&gt;&lt;/span&gt;&lt;/dt&gt;\n        &lt;dd&gt;&lt;span class=&quot;divido-deposit&quot; data-divido-choose-deposit data-divido-label=&quot;{{ text_choose_deposit }}&quot; data-divido-form=&quot;divido_deposit&quot;&gt;&lt;/span&gt;&lt;/dd&gt;\n    &lt;/dl&gt;\n    &lt;div class=&quot;description&quot;&gt;\n        &lt;strong&gt;\n        &lt;span data-divido-agreement-duration&gt;&lt;/span&gt; {{ text_monthly_payments }} &lt;span data-divido-monthly-instalment&gt;&lt;/span&gt;\n        &lt;/strong&gt;\n    &lt;/div&gt;\n    &lt;div class=&quot;divido-info&quot;&gt;\n        &lt;dl&gt;\n            &lt;dt&gt;{{ text_term }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-agreement-duration&gt;&lt;/span&gt; {{ text_months }}&lt;/dd&gt;\n            &lt;dt&gt;{{ text_monthly_installment }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-monthly-instalment&gt;&lt;/span&gt;&lt;/dd&gt;\n            &lt;dt&gt;{{ text_deposit }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-deposit&gt;&lt;/span&gt;&lt;/dd&gt;\n            &lt;dt&gt;{{ text_credit_amount }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-credit-amount-rounded&gt;&lt;/span&gt;&lt;/dd&gt;\n            &lt;dt&gt;{{ text_amount_payable }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-total-payable-rounded&gt;&lt;/span&gt;&lt;/dd&gt;\n            &lt;dt&gt;{{ text_total_interest }}&lt;/dt&gt;\n            &lt;dd&gt;&lt;span data-divido-interest-rate&gt;&lt;/span&gt;&lt;/dd&gt;\n        &lt;/dl&gt;\n    &lt;/div&gt;\n    &lt;div class=&quot;clear&quot;&gt;&lt;/div&gt;\n&lt;/div&gt;\n', '2019-09-16 11:48:03'),
(14, 0, 'default', 'extension/module/html', '&lt;div&gt;{% if heading_title %}\n  &lt;h2&gt;{{ heading_title }}&lt;/h2&gt;\n  {% endif %}\n  {{ html }}&lt;/div&gt;\n', '2019-09-16 11:48:11'),
(15, 0, 'default', 'extension/module/store', '&lt;div class=&quot;panel panel-default&quot;&gt;\n  &lt;div class=&quot;panel-heading&quot;&gt;{{ heading_title }}&lt;/div&gt;\n  &lt;p style=&quot;text-align: center;&quot;&gt;{{ text_store }}&lt;/p&gt;\n  {% for store in stores %}\n  {% if store.store_id == store_id %}&lt;a href=&quot;{{ store.url }}&quot;&gt;&lt;b&gt;{{ store.name }}&lt;/b&gt;&lt;/a&gt;&lt;br /&gt;\n  {% else %}&lt;a href=&quot;{{ store.url }}&quot;&gt;{{ store.name }}&lt;/a&gt;&lt;br /&gt;\n  {% endif %}\n  {% endfor %}&lt;br /&gt;\n&lt;/div&gt;\n', '2019-09-16 11:48:32'),
(21, 0, 'default', 'extension/module/featured', '&lt;h3&gt;{{ heading_title }}&lt;/h3&gt;\n&lt;div class=&quot;row&quot;&gt;\n {% for product in products %}\n  &lt;div class=&quot;product-layout col-lg-3 col-md-3 col-sm-6 col-xs-12&quot;&gt;\n    &lt;div class=&quot;product-thumb transition&quot;&gt;\n      &lt;div class=&quot;thumbnail&quot;&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;&lt;img data-src=&quot;{{ product.thumb }}&quot; alt=&quot;{{ product.name }}&quot; title=&quot;{{ product.name }}&quot; class=&quot;lozad&quot; /&gt;&lt;/a&gt;&lt;/div&gt;\n      &lt;div class=&quot;caption&quot;&gt;\n        &lt;h4&gt;&lt;a href=&quot;{{ product.href }}&quot;&gt;{{ product.name }}&lt;/a&gt;&lt;/h4&gt;\n        &lt;p&gt;{{ product.description }}&lt;/p&gt;\n        {% if product.rating %}\n        &lt;div class=&quot;rating&quot;&gt;\n          {% for i in 5 %}\n          {% if product.rating &lt; i %}\n          &lt;span class=&quot;fa fa-stack&quot;&gt;&lt;i class=&quot;fa fa-star-o fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;/span&gt;\n          {% else %}\n          &lt;span class=&quot;fa fa-stack&quot;&gt;&lt;i class=&quot;fa fa-star fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;i class=&quot;fa fa-star-o fa-stack-2x&quot;&gt;&lt;/i&gt;&lt;/span&gt;\n          {% endif %}\n          {% endfor %}\n        &lt;/div&gt;\n        {% endif %}\n        {% if product.price %}\n        &lt;p class=&quot;price&quot;&gt;\n          {% if not product.special %}\n          {{ product.price }}\n          {% else %}\n          &lt;span class=&quot;price-new&quot;&gt;{{ product.special }}&lt;/span&gt; &lt;span class=&quot;price-old&quot;&gt;{{ product.price }}&lt;/span&gt;\n          {% endif %}\n          {% if product.tax %}\n          &lt;span class=&quot;price-tax&quot;&gt;{{ text_tax }} {{ product.tax }}&lt;/span&gt;\n          {% endif %}\n        &lt;/p&gt;\n        {% endif %}\n      &lt;/div&gt;\n      &lt;div class=&quot;button-group&quot;&gt;\n        &lt;button type=&quot;button&quot; onclick=&quot;cart.add(\'{{ product.product_id }}\');&quot;&gt;&lt;i class=&quot;fa fa-shopping-cart&quot;&gt;&lt;/i&gt; &lt;span class=&quot;hidden-xs hidden-sm hidden-md&quot;&gt;{{ button_cart }}&lt;/span&gt;&lt;/button&gt;\n        &lt;button type=&quot;button&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_wishlist }}&quot; onclick=&quot;wishlist.add(\'{{ product.product_id }}\');&quot;&gt;&lt;i class=&quot;fa fa-heart&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n        &lt;button type=&quot;button&quot; data-toggle=&quot;tooltip&quot; title=&quot;{{ button_compare }}&quot; onclick=&quot;compare.add(\'{{ product.product_id }}\');&quot;&gt;&lt;i class=&quot;fa fa-exchange&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n      &lt;/div&gt;\n    &lt;/div&gt;\n  &lt;/div&gt;\n  {% endfor %}\n&lt;/div&gt;\n\n&lt;script type=&quot;text/javascript&quot;&gt;&lt;!--\n$(document).ready(function() {\n    const observer = lozad();\n    observer.observe();\n});\n//--&gt;&lt;/script&gt; ', '2019-09-20 20:02:33'),
(19, 0, 'default', 'common/menu', '{% if categories %}\n&lt;div class=&quot;container&quot;&gt;\n  &lt;nav id=&quot;menu&quot; class=&quot;navbar&quot;&gt;\n    &lt;div class=&quot;navbar-header&quot;&gt;&lt;span id=&quot;category&quot; class=&quot;visible-xs&quot;&gt;{{ text_category }}&lt;/span&gt;\n      &lt;button type=&quot;button&quot; class=&quot;btn btn-navbar navbar-toggle&quot; data-toggle=&quot;collapse&quot; data-target=&quot;.navbar-ex1-collapse&quot;&gt;&lt;i class=&quot;fa fa-bars&quot;&gt;&lt;/i&gt;&lt;/button&gt;\n    &lt;/div&gt;\n    &lt;div class=&quot;collapse navbar-collapse navbar-ex1-collapse&quot;&gt;\n      &lt;ul class=&quot;nav navbar-nav&quot;&gt;\n        {% for category in categories %}\n        {% if category.children %}\n        &lt;li class=&quot;dropdown&quot;&gt;&lt;a href=&quot;{{ category.href }}&quot; class=&quot;dropdown-toggle&quot; data-toggle=&quot;dropdown&quot;&gt;{{ category.name }}&lt;/a&gt;\n          &lt;div class=&quot;dropdown-menu&quot;&gt;\n            &lt;div class=&quot;dropdown-inner&quot;&gt; {% for children in category.children|batch(category.children|length / category.column|round(1, \'ceil\')) %}\n              &lt;ul class=&quot;list-unstyled&quot;&gt;\n                {% for child in children %}\n                &lt;li&gt;&lt;a href=&quot;{{ child.href }}&quot;&gt;{{ child.name }}&lt;/a&gt;&lt;/li&gt;\n                {% endfor %}\n              &lt;/ul&gt;\n              {% endfor %}&lt;/div&gt;\n            &lt;a href=&quot;{{ category.href }}&quot; class=&quot;see-all&quot;&gt;{{ text_all }} {{ category.name }}&lt;/a&gt; &lt;/div&gt;\n        &lt;/li&gt;\n        {% else %}\n        &lt;li&gt;&lt;a href=&quot;{{ category.href }}&quot;&gt;{{ category.name }}&lt;/a&gt;&lt;/li&gt;\n        {% endif %}\n        {% endfor %}\n      &lt;/ul&gt;\n    &lt;/div&gt;\n  &lt;/nav&gt;\n&lt;/div&gt;\n{% endif %} ', '2019-09-16 15:39:35');
